import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';


const Note  =()=>{
    return(
        <div className="note">
           <h1>Title</h1>
           <br/>
           <p>This is the content </p>
           <DeleteIcon className="delete"/>
        </div>

    )
}

export default Note;
